import { setAllButtonFalse } from '@/assets/setButton.js'


class SetClientsModelButton {
    getUserClientModel (messageCatch) {
        
        return JSON.parse(messageCatch.message).clients_model
    }
    
    setButtonStatus (messageCatch) {
        var button_class = "btn-check header-button-client"
        setAllButtonFalse(button_class)
        document.getElementById(`btn-check-outlined ${this.getUserClientModel(messageCatch)}_model`).checked = true
    }
}

export default SetClientsModelButton;
